bool isNextToFire(){
    position_t pos = civilians_positions[id];
    int start_row, start_col;
    int end_row, end_col;
    int i=0;
    int j=0;

    start_row = pos.row > 0 ? pos.row-1 : pos.row;
    end_row = pos.row < GRID_HEIGHT-1 ? pos.row+1 : pos.row;

    start_col = pos.col > 0 ? pos.col-1 : pos.col;
    end_col = pos.col < GRID_WIDTH-1 ? pos.col+1 : pos.col;


    for(i=start_row;i<=end_row; i++){
        for(j=start_col;j<=end_col;j++){
            /*if( !(i == pos.row && j == pos.col) && grid[i][j]==EXIT ){
                return false;
            }*/
            if( !(i == pos.row && j == pos.col) && grid[i][j]==FIRE ){
                return true;
            }
        }
    }
    return false;

}

bool isNextToExit(){
    position_t pos = civilians_positions[id];
    int start_row, start_col;
    int end_row, end_col;
    int i=0;
    int j=0;

    start_row = pos.row > 0 ? pos.row-1 : pos.row;
    end_row = pos.row < GRID_HEIGHT-1 ? pos.row+1 : pos.row;

    start_col = pos.col > 0 ? pos.col-1 : pos.col;
    end_col = pos.col < GRID_WIDTH-1 ? pos.col+1 : pos.col;


    for(i=start_row;i<=end_row; i++){
        for(j=start_col;j<=end_col;j++){
            if( !(i == pos.row && j == pos.col) && grid[i][j]==EXIT ){
                return true;
            }
        }
    }
    return false;

}

bool isCloserToExit(int new){
    position_t old_pos = civilians_positions[id];
    position_t pos = civilians_positions[id];
    position_t closest_exit;
    int i;

    closest_exit = exits_positions[0];

    for(i = 1; i< EXIT_NUM;i++){
        if(manhattan_distance(pos,exits_positions[i]) < manhattan_distance(pos,closest_exit)){
            closest_exit = exits_positions[i];
        }
    }
    if(new == U){
        pos.row--;
    }else if (new == D){
        pos.row++;
    }else if (new == R){
        pos.col++;
    }else if (new == L){
        pos.col--;
    }

    return (manhattan_distance(old_pos,closest_exit)>manhattan_distance(pos,closest_exit));

}


bool CanGoRight(){
    position_t pos = civilians_positions[id];
    return ((pos.col < GRID_WIDTH-1) && grid[pos.row][pos.col + 1]==0 && isCloserToExit(R));
}

bool CanGoLeft(){
    position_t pos = civilians_positions[id];
    return ((pos.col > 0) && grid[pos.row][pos.col - 1]==0 && isCloserToExit(L));
}

bool CanGoUp(){
    position_t pos = civilians_positions[id];
    return ((pos.row > 0) && grid[pos.row - 1][pos.col]==0 && isCloserToExit(U));
}

bool CanGoDown(){
    position_t pos = civilians_positions[id];
    return ((pos.row < GRID_HEIGHT-1) && grid[pos.row + 1][pos.col]==0 && isCloserToExit(D));
}

bool CantMove(){
    return (!(CanGoRight() || CanGoLeft() || CanGoUp() || CanGoDown()));
}

void become_needy(){
    position_t pos = civilians_positions[id];
    grid[pos.row][pos.col] = NEEDY_CIV;
}

