//Check FR's own position and set booleans according to the surroundings. Sets the needy civilian to RESCUING state.
void checkPosition(){
    int start_row, start_col;
    int end_row, end_col;
    bool break = false;
    int i = 0;
    int j = 0;
    int k = 0;
    position_t position = {-1,-1};
    position = first_responders_positions[id];

    grid[position.row][position.col]=FIRST_RESPONDER;

    start_row = position.row > 0 ? position.row-1 : position.row;
    end_row = position.row < GRID_HEIGHT-1 ? position.row+1 : position.row;

    start_col = position.col > 0 ? position.col-1 : position.col;
    end_col = position.col < GRID_WIDTH-1 ? position.col+1 : position.col;


    for(i=start_row;i<=end_row && !break; i++){
        for(j=start_col;j<=end_col && !break;j++){
            if( !(i == position.row && j == position.col) ){

                if(grid[i][j]==NEEDY_CIV){
                    isNextToNeedy = true;
                    grid[i][j]=RESCUING;
                    for(k = 0; k < CIVILIAN_NUMBER; k++){
                        if(civilians_positions[k].row == i && civilians_positions[k].col == j && civilians_positions[k].row !=-1){
                            needy_id = k;

                        }
                    }
                    break=true;
                }

            }
        }
    }
    //CanGoR = (position.col < GRID_WIDTH-1) && !isNextToNeedy && grid[position.row][position.col + 1]==0;
    //CanGoL = (position.col > 0) && !isNextToNeedy && grid[position.row][position.col - 1]==0;
    //CanGoUp = (position.row > 0) && !isNextToNeedy && grid[position.row - 1][position.col]==0;
    //CanGoD = (position.row < GRID_HEIGHT-1) && !isNextToNeedy && grid[position.row + 1][position.col]==0;
}

