bool fr_on_path(){
    position_t pos = first_responders_positions[id];
    int i;
    if(pos.row < 0 || pos.row > GRID_HEIGHT-1 || pos.col < 0 || pos.col > GRID_WIDTH-1){return false;}
    i = getFRPath(pos);
    return i != 0;
}

void moveTowardsPath(){
    position_t pos = first_responders_positions[id];
    int i; 
    int min_md = GRID_HEIGHT + GRID_WIDTH;    // don't have max()...
    int local_md = min_md;
    position_t closest;

    // Gotta find the closest point of the path...
    for(i=0;i<FR_PATH_LEN;i++){
        local_md = manhattan_distance(pos, first_responders_path[i].p);
        //min_md = local_md < min_md ? local_md : min_md;
        if(local_md < min_md){
            min_md = local_md;
            closest = first_responders_path[i].p;
        }
    }
    // found our "entry point" to the path: now move
    moveTowards(closest);
}

void moveAwayFromPath(){ //called when on path but not possible to follow it
    position_t pos = first_responders_positions[id];
    int d = getFRPath(pos);
    if(d == D && CanGoLeft()){ //fire on our right
        Move_Left();
    }else if(d == R && CanGoDown()){        // fire above
        Move_Down();
    }else if(d == U && CanGoUp()){
        Move_Up();
    }else if(d == L && CanGoLeft()){
        Move_Left();
    }else{    // Can neither move along path nor away from fire: stay here and wait for someone else to move
        //checkPosition();
        return;
    }
}

