    int i;
    setFire();
    setExits();
    setDronesPath();
    setFirstRespondersPath();
    for(i=0;i< CIVILIAN_NUMBER;i++){
        go_save_zr[i] = DEFAULT;
        go_call[i] = DEFAULT; 
    }
    for(i=0; i < FIRST_RESPONDER_NUMBER; i++){
        go_save_fr[i] = DEFAULT;
    }
}

